The Spectre (2014-05) Volume 1 - Crimes and Judgements (digital) (OkC.O.M.P.U.T.O.-Novus-HD)

Promotional info - &quot;In these never-before-collected tales from the 1990s, police detective Jim Corrigan tries to end his mission as The Spectre. But the grisly crimes of a serial killer pulls him back into the battle for justice--and sends him on a trip to hell itself. And the enigmatic mystic known as Madame Xanadu tries to help Corrigan and his friends--but her help may lead one of them to commit suicide.&quot;

Written by John Ostrander and illustrated by Tom Mandrake. Thanks to OkC.O.M.P.U.T.O.-Novus-HD for this digital copy, please seed and enjoy. :-)

